import React, { useEffect, useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

export default function FreelancerDashboard() {
  const [proposals, setProposals] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");
  const [page, setPage] = useState(0);
  const [hasMore, setHasMore] = useState(true);
  const navigate = useNavigate();

  const token = localStorage.getItem("token");
  const freelancerId = localStorage.getItem("userId");
  const pageSize = 2;

  const fetchProposals = async (currentPage) => {
    try {
      const response = await axios.get(
        `http://localhost:8080/proposal/freelancer/${freelancerId}?page=${currentPage}&size=${pageSize}`,
        { headers: { Authorization: `Bearer ${token}` } }
      );

      if (response.data.length < pageSize) setHasMore(false);

      setProposals(response.data);
    } catch (err) {
      console.error(err.response || err);
      setError("Error fetching proposals.");
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    if (!token) {
      setError("You are not logged in!");
      setLoading(false);
      return;
    }
    fetchProposals(page);
  }, [token, freelancerId, page]);

  if (loading) return <p>Loading proposals...</p>;
  if (error) return <p style={{ color: "red" }}>{error}</p>;

  return (
    <div style={{ padding: "20px" }}>
      <h2>My Projects</h2>
      {proposals.length === 0 ? (
        <p>No proposals submitted yet.</p>
      ) : (
        <>
          <ul style={{ listStyle: "none", padding: 0 }}>
            {proposals.map((proposal) => (
              <li key={proposal.id} style={{ marginBottom: "15px", border: "1px solid #ccc", padding: "10px", borderRadius: "5px" }}>
                <h3>{proposal.project.title}</h3>
                <p><strong>Description:</strong> {proposal.project.description}</p>
                <p><strong>Budget:</strong> {proposal.project.minBudget} - {proposal.project.maxBudget}</p>
                <p><strong>Deadline:</strong> {new Date(proposal.project.deadline).toLocaleDateString()}</p>
                <p><strong>Skills:</strong> {proposal.project.skills.join(", ")}</p>
                <p><strong>Bid Amount:</strong> {proposal.bidAmount}</p>
                <p><strong>Status:</strong> {proposal.status}</p>

                {proposal.status === "ACCEPTED" && (
                  <div style={{ display: "flex", gap: "10px", marginTop: "10px" }}>
                    <button onClick={() => navigate(`/milestones/${proposal.projectId}`)}>View More</button>
                    <button onClick={() => navigate(`/contracts/create?proposalId=${proposal.id}`)}>Create Contract</button>
                  </div>
                )}
              </li>
            ))}
          </ul>

          <div style={{ marginTop: "10px" }}>
            <button disabled={page === 0} onClick={() => setPage(page - 1)}>Previous</button>
            <button disabled={!hasMore} onClick={() => setPage(page + 1)}>Next</button>
          </div>
        </>
      )}
    </div>
  );
}
